import data from "./data";
import {createBrowserRouter, RouterProvider} from "react-router-dom";
import HomeScreen from "./screens/HomeScreen";

const router = createBrowserRouter([
  {
    path: "/",
    element: <HomeScreen />,
  },
]);

function App() {
  return (
      <div>
        <header>
          <a href="/">Glitter</a>
        </header>
        <main>

          <RouterProvider router={router} />

        </main>
      </div>
  );
}

export default App;
